import "../App.css";
import React from 'react';
import './App.css';
import { useState, useEffect } from "react";
import axios from "axios";
import AddUser from './AddMembers';
import NewGroup from './AddGroups';

function App() {
const [member, setMember] = useState([]);
const [groups, setGroups] = useState([]);


const getMember = () => {
  axios.get("http://localhost:3000/member").then((res) => {
    setMember(res.data);
  });
};



const getGroups = () => {
  axios.get("http://localhost:3000/groups").then((res) => {
    setGroups(res.data);
  });
};


  return (
    <div className="App">
      <header className="App-header">
      </header>
      <AddUser member={member} setMember={setMember} />

      <div className="member">
          {member.map((item) => {
              return (
                <div className="member">
                   <h3>username: {item.username}</h3>
                    <h3>zip: {item.zip}</h3>
                    <h3>city: {item.city}</h3>
                    <h3>state: {item.state}</h3>
                </div>
              );
          })}
      </div>
  </div>

  );
} 

export default App;
